Create Table `replacementcharges`(
`Id` BIGINT(20) NOT NULL AUTO_INCREMENT,
`FranchiseeId` BIGINT(20) NULL ,
`Material` varchar(255) NULL ,
`CostOfRemovingTile` DECIMAL(18,2) Null,
`CostOfInstallingTile` DECIMAL(18,2) Null,
`CostOfTileMaterial` DECIMAL(18,2) NULL ,
`TotalReplacementCost` DECIMAL(18,2) NULL ,
`IsPriceChangedByFranchisee` BIT(1) NULL DEFAULT b'0',
`IsActive` BIT(1) NULL DEFAULT b'0',
`IsDeleted` BIT(1) NULL DEFAULT b'0' ,
`DataRecorderMetaDataId` BigInt(20) null,
PRIMARY KEY (`Id`),
INDEX `fk_replacementcharges_franchiseeId_idx` (`FranchiseeId` ASC) ,
CONSTRAINT `fk_replacementcharges_franchiseeid_idx`
FOREIGN KEY (`FranchiseeId`)
REFERENCES `franchisee` (`Id`),
INDEX `fk_replacementcharges_datarecordermetadataId_idx` (`DataRecorderMetaDataId` ASC) ,
CONSTRAINT `fk_replacementcharges_datarecordermetadataId_idx`
FOREIGN KEY (`DataRecorderMetaDataId`)
REFERENCES `DataRecorderMetaData` (`Id`)
);



